    true,nt"url": null,nt"notes": "<p>National Average Drug Acquisition Cost
    (NADAC) - Below are the NADAC weekly files and the weekly comparison files. Please
    note that the NADAC file is updated on a weekly basis. Each month, a new file is
    posted to reflect findings from the previous months survey results incorporating
    the weekly price changes that have occurred in the interim weeks before the next
    monthly NADAC file.  For more information on the fields in the NADAC weekly file,
    please see the NADAC Data Field Definitions.  In addition, to easily identify and
    understand the pricing changes that occur each week, we are posting a NADAC week
    to week file comparison, called the NADAC Weekly Comparison, to accompany the weekly
    NADAC file.  This comparison file identifies the drug products with current NADAC
    rates that are replaced with new NADAC rates.  Other changes (e.g. NDC additions
    and terminations) to the NADAC file are not reflected in this comparison.  The explanation
    of the data fields used in the weekly comparison file are further defined in the
    NADAC Week to Week Data Field Definitions.</p>n",nt"license_title": "Other
